// src/SensorData.js
import React, { useState, useEffect } from 'react';

function SensorData() {
  const [sensorReading, setSensorReading] = useState({});
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Fetch temperature reading data from the Spring Boot API
    fetch('http://localhost:8080/sensors/temperature?sensorId=sensor1')
      .then((response) => response.json())
      .then((data) => {
        setSensorReading(data);
        setLoading(false);
      });
  }, []);

  return (
    <div>
      <h2>Sensor Data</h2>
      {loading ? (
        <p>Loading...</p>
      ) : (
        <div>
          <p>Sensor ID: {sensorReading.sensorId}</p>
          <p>Type: {sensorReading.type}</p>
          <p>Reading: {sensorReading.reading}</p>
        </div>
      )}
    </div>
  );
}

export default SensorData;
